// App.js

import React, { useState, useEffect } from 'react';
import './App.css';
import Calendar from './Calendar';
import HourPicker from './HourPicker'; // Importuj nowy komponent
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Zmieniłem na Routes
import axios from 'axios';

const App = () => {
  const [calendarDays, setCalendarDays] = useState([]);

  useEffect(() => {
    // Pobierz dni z backendu i ustaw je w stanie
    axios.get('http://localhost:5000/api/calendar')
      .then(response => {
        setCalendarDays(response.data);
      })
      .catch(error => {
        console.error('Error fetching calendar days:', error);
      });
  }, []);

  return (
    <Router>
      <div className="App">
        <h1>Calendar App</h1>
        <Routes> {/* Zmieniłem na Routes */}
          <Route path="/" element={<Calendar calendarDays={calendarDays} />} /> {/* Użyj elementu dla Route */}
          <Route path="/test" element={<HourPicker />} /> {/* Użyj elementu dla Route */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
